import Live from "./Live";
import Nav from "./Nav";
import SectionFirst from "./SectionFirst";
import SectionSecond from "./SectionSecond";
import SectionThird from "./SectionThird";


function Wrap() {
  return (
    <div className="h-screen">
    <Nav/>
    <SectionFirst/>
    <Live/>
    <SectionSecond/>
    <SectionThird/>
    </div>
  );
}

export default Wrap;
